import React from 'react';

const LoginText = () => {
  return (
    <React.Fragment>
      <h1 className='text-center text-gradient display-1 font-weight-bold'>
        Superheros App
      </h1>
      <p className='p-1 text-center w-75 text-white mx-auto'>
        Assemble your dreamed superhero squad from a pool of heros full of
        hundreds of them!
      </p>
    </React.Fragment>
  );
};

export default LoginText;
